// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import {IWasmd} from "./precompiles/IWasmd.sol";
import {IJson} from "./precompiles/IJson.sol";
import {IAddr} from "./precompiles/IAddr.sol";

contract CW721ERC721Wrapper is ERC721 {

    address constant WASMD_PRECOMPILE_ADDRESS = 0x0000000000000000000000000000000000001002;
    address constant JSON_PRECOMPILE_ADDRESS = 0x0000000000000000000000000000000000001003;
    address constant ADDR_PRECOMPILE_ADDRESS = 0x0000000000000000000000000000000000001004;

    string public Cw721Address;
    IWasmd public WasmdPrecompile;
    IJson public JsonPrecompile;
    IAddr public AddrPrecompile;

    constructor(string memory Cw721Address_, string memory name_, string memory symbol_) ERC721(name_, symbol_) {
        WasmdPrecompile = IWasmd(WASMD_PRECOMPILE_ADDRESS);
        JsonPrecompile = IJson(JSON_PRECOMPILE_ADDRESS);
        AddrPrecompile = IAddr(ADDR_PRECOMPILE_ADDRESS);
        Cw721Address = Cw721Address_;
    }

    // Queries
    function balanceOf(address owner) public view override returns (uint256) {
        if (owner == address(0)) {
            revert ERC721InvalidOwner(address(0));
        }
        string memory ownerAddr = _formatPayload("owner", _doubleQuotes(AddrPrecompile.getSeiAddr(owner)));
        string memory req = _curlyBrace(_formatPayload("tokens", _curlyBrace(ownerAddr)));
        bytes memory response = WasmdPrecompile.query(Cw721Address, bytes(req));
        bytes[] memory tokens = JsonPrecompile.extractAsBytesList(response, "tokens");
        return tokens.length;
    }

    function ownerOf(uint256 tokenId) public view override returns (address) {
        string memory tId = _formatPayload("token_id", _doubleQuotes(Strings.toString(tokenId)));
        string memory req = _curlyBrace(_formatPayload("owner_of", _curlyBrace(tId)));
        bytes memory response = WasmdPrecompile.query(Cw721Address, bytes(req));
        bytes memory owner = JsonPrecompile.extractAsBytes(response, "owner");
        return AddrPrecompile.getEvmAddr(string(owner));
    }

    function getApproved(uint256 tokenId) public view override returns (address) {
        string memory spender = _formatPayload("spender", _doubleQuotes(AddrPrecompile.getSeiAddr(msg.sender)));
        string memory tId = _formatPayload("token_id", _doubleQuotes(Strings.toString(tokenId)));
        string memory req = _curlyBrace(_formatPayload("approval", _curlyBrace(_join(spender, tId, ","))));
        bytes memory response = WasmdPrecompile.query(Cw721Address, bytes(req));
        bytes memory approval = JsonPrecompile.extractAsBytes(response, "approval");
        bytes memory res = JsonPrecompile.extractAsBytes(approval, "spender");
        return AddrPrecompile.getEvmAddr(string(res));
    }

    function isApprovedForAll(address owner, address operator) public view override returns (bool) {
        string memory o = _formatPayload("owner", _doubleQuotes(AddrPrecompile.getSeiAddr(owner)));
        string memory req = _curlyBrace(_formatPayload("all_operators", _curlyBrace(o)));
        bytes memory response = WasmdPrecompile.query(Cw721Address, bytes(req));
        bytes[] memory approvals = JsonPrecompile.extractAsBytesList(response, "operators");
        for (uint i=0; i<approvals.length; i++) {
            bytes memory op = JsonPrecompile.extractAsBytes(approvals[i], "spender");
            if (AddrPrecompile.getEvmAddr(string(op)) == operator) {
                return true;
            }
        }
        return false;
    }

    function tokenURI(uint256 tokenId) public view override returns (string memory) {
        // revert if token isn't owned
        ownerOf(tokenId);
        string memory tId = _formatPayload("token_id", _doubleQuotes(Strings.toString(tokenId)));
        string memory req = _curlyBrace(_formatPayload("nft_info", _curlyBrace(tId)));
        bytes memory response = WasmdPrecompile.query(Cw721Address, bytes(req));
        bytes memory uri = JsonPrecompile.extractAsBytes(response, "token_uri");
        return string(uri);
    }

    // Transactions
    function transferFrom(address from, address to, uint256 tokenId) public override {
        if (to == address(0)) {
            revert ERC721InvalidReceiver(address(0));
        }
        string memory recipient = _formatPayload("recipient", _doubleQuotes(AddrPrecompile.getSeiAddr(to)));
        string memory tId = _formatPayload("token_id", _doubleQuotes(Strings.toString(tokenId)));
        string memory req = _curlyBrace(_formatPayload("transfer_nft", _curlyBrace(_join(recipient, tId, ","))));
        _execute(bytes(req));
        emit Transfer(from, to, tokenId);
    }

    function approve(address approved, uint256 tokenId) public override {
        string memory spender = _formatPayload("spender", _doubleQuotes(AddrPrecompile.getSeiAddr(approved)));
        string memory tId = _formatPayload("token_id", _doubleQuotes(Strings.toString(tokenId)));
        string memory req = _curlyBrace(_formatPayload("approve", _curlyBrace(_join(spender, tId, ","))));
         _execute(bytes(req));
         emit Approval(ownerOf(tokenId), approved, tokenId);
    }

    function setApprovalForAll(address operator, bool approved) public override {
        string memory op = _curlyBrace(_formatPayload("operator", _doubleQuotes(AddrPrecompile.getSeiAddr(operator))));
        if (approved) {
            _execute(bytes(_curlyBrace(_formatPayload("approve_all", op))));
        } else {
            _execute(bytes(_curlyBrace(_formatPayload("revoke_all", op))));
        }
        emit ApprovalForAll(msg.sender, operator, approved);
    }

    function _execute(bytes memory req) internal returns (bytes memory) {
        (bool success, bytes memory ret) = WASMD_PRECOMPILE_ADDRESS.delegatecall(
            abi.encodeWithSignature(
                "execute(string,bytes,bytes)",
                Cw721Address,
                bytes(req),
                bytes("[]")
            )
        );
        require(success, "CosmWasm execute failed");
        return ret;
    }

    function _formatPayload(string memory key, string memory value) internal pure returns (string memory) {
        return _join(_doubleQuotes(key), value, ":");
    }

    function _curlyBrace(string memory s) internal pure returns (string memory) {
        return string.concat("{", string.concat(s, "}"));
    }

    function _doubleQuotes(string memory s) internal pure returns (string memory) {
        return string.concat("\"", string.concat(s, "\""));
    }

    function _join(string memory a, string memory b, string memory separator) internal pure returns (string memory) {
        return string.concat(a, string.concat(separator, b));
    }
}

src/EVMCompatibilityTester.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "./TestToken.sol";

contract EVMCompatibilityTester {
    // verify different events with var types
    event ActionPerformed(string action, address indexed performer);
    event BoolSet(address performer, bool value);
    event AddressSet(address indexed performer);
    event Uint256Set(address indexed performer, uint256 value);
    event StringSet(address indexed performer, string value);
    event LogIndexEvent(address indexed performer, uint256 value);

    struct MsgDetails {
        address sender;
        uint256 value;
        bytes data;
        uint256 gas;
    }

    // Example of contract storing and retrieving data
    uint256 private storedData;

    // deployer of the contract
    address public owner;

    // one of each type
    address public addressVar;
    bool public boolVar;
    uint256 public uint256Var;
    string public stringVar;

    // State variable to store the details
    MsgDetails public lastMsgDetails;

    mapping(address => uint256) public balances;

    constructor() {
        owner = msg.sender;
    }

    function storeData(uint256 data) public {
        storedData = data;
        emit ActionPerformed("Data Stored", msg.sender);
    }

    // Function to set a balance for a specific address
    function setBalance(address user, uint256 amount) public {
        balances[user] = amount;
        emit ActionPerformed("Balance Set", msg.sender);
    }

    function setAddressVar() public {
        addressVar = msg.sender;
        emit AddressSet(msg.sender);
    }

    function setBoolVar(bool value) public {
        boolVar = value;
        emit BoolSet(msg.sender, value);
    }

    function emitMultipleLogs(uint256 count) public {
        for (uint256 i = 0; i < count; i++) {
            emit LogIndexEvent(msg.sender, i);
        }
    }

    function setStringVar(string memory value) public {
        stringVar = value;
        emit StringSet(msg.sender, value);
    }

    function setUint256Var(uint256 value) public {
        uint256Var = value;
        emit Uint256Set(msg.sender, value);
    }

    // verify returning of private var
    function retrieveData() public view returns (uint256) {
        return storedData;
    }

    // Example of inter-contract calls
    function callAnotherContract(address contractAddress, bytes memory data) public {
        (bool success, ) = contractAddress.call(data);
        require(success, "Call failed");
        emit ActionPerformed("Inter-Contract Call", msg.sender);
    }

    // Example of creating a new contract from a contract
    function createToken(string memory name, string memory symbol) public {
        TestToken token = new TestToken(name, symbol);
        token.transfer(msg.sender, 100);
    }

    // Example of inline assembly: a simple function to add two numbers
    function addNumbers(uint256 a, uint256 b) public pure returns (uint256 sum) {
        assembly {
            sum := add(a, b)
        }
    }

    // Inline assembly for accessing contract balance
    function getContractBalance() public view returns (uint256 contractBalance) {
        assembly {
            contractBalance := selfbalance()
        }
    }

    function getBlockProperties() public view returns (bytes32 blockHash, address payable coinbase, uint prevrandao, uint gaslimit, uint number, uint timestamp) {
        blockHash = blockhash(block.number - 1);
        coinbase = block.coinbase;
        prevrandao = block.prevrandao;
        gaslimit = block.gaslimit;
        number = block.number;
        timestamp = block.timestamp;

        return (blockHash, coinbase, prevrandao, gaslimit, number, timestamp);
    }


    function revertIfFalse(bool value) public {
        boolVar = value;
        require(value == true, "value must be true");
    }

    // More complex example: Inline assembly to read from storage directly
    function readFromStorage(uint256 storageIndex) public view returns (uint256 data) {
        assembly {
            data := sload(storageIndex)
        }
    }

    // Function to store some properties of 'msg'
    function storeMsgProperties() public payable {
        // Storing the properties of 'msg'
        lastMsgDetails = MsgDetails({
            sender: msg.sender,
            value: msg.value,
            data: msg.data,
            gas: gasleft()
        });
    }

    function depositEther() external payable {
        require(msg.value > 0, "No Ether sent");
    }

    function sendEther(address payable recipient, uint256 amount) external payable {
        require(msg.sender == owner, "Only owner can send Ether");
        require(address(this).balance >= amount, "Insufficient balance");
        recipient.transfer(amount);
    }
}

